import "./Header.css";
import UserFinder from "./UserFinder/UserFinder.js";
import UserSorter from "./UserSorter/UserSorter";
import UserReset from "./UserReset/UserReset";

const Header = (props) => {
  return (
    <form>
      <UserFinder />
      <UserSorter />
      <UserReset />
    </form>
  );
};

export default Header;
